import jsTPS_Transaction from "../common/jsTPS.js"
/**
 * AddSong_Transaction
 * 
 * This class represents a transaction that works with adding a 
 * song. It will be managed by the transaction stack.
 * 
 */
export default class AddSong_Transaction extends jsTPS_Transaction {
    constructor(store) {
        super();
        this.store = store;
    }

    doTransaction() {
        console.log(this.store);
        this.store.addNewSong();
    }

    undoTransaction() {
        let length = this.store.currentList.songs.length;
        this.store.setSongForDeletion(length-1);
        this.store.deleteSongFromList();
    }
}
